import PropTypes from 'prop-types'

function Header({ text,bgColor, textColor }) {

  const headerStyles = {
    backgroundColor : 'blue', 
    color:'red',
  }
  return (
    <header style = {headerStyles}>
        <div className="container">
            <h1>{text}</h1>
        </div>
    </header>
  )
}

Header.defaultProps = {
    text: "Feedback UI",
  };
Header.propTypes = {
    text: PropTypes.string
  };
export default Header
